    return {
      backgroundImage:`url("http://localhost:5000/background")`,
      backgroundPosition:"center center",
      backgroundSize:"cover",
      backgroundRepeat: "no-repeat"
    }
  }

  return (
    <div className="App">
      <Header/>
      <div className='container' >

        <Intro/>

      </div>
    </div>
  );
}

export default App;
